Rhizome DC will neither collaborate with nor provide or accept funding from state-sponsored Israeli institutions and organizations unless & until the state of Israel meets the three demands of the BDS call: to end the Israeli occupation & colonization of all Palestinian lands and dismantle the wall; to recognize the fundamental rights of the Arab-Palestinian citizens of Israel to full equality; & to respect, protect, & promote the right of Palestinian refugees to return to their homes & properties, as stipulated in UN Resolution 194.

The BDS movement, including PACBI, rejects on principle boycotts of individuals based on their identity (such as citizenship, race, gender, sexuality, or religion) or opinion. This is not a boycott of Israeli artists but of an apartheid state.

We urge all arts organizations, artists, & cultural workers to join us in committing to the Palestinian international call for BDS, & to comply with PACBI.

